  "oldLetterResponseDto" : {
    "id" : 477764,
    "subject" : "नाम परिबर्तन, रजिष्टर्ड कार्यालयको ठेगाना परिबर्तन र पूँजी वृद्धि सहितको प्रबन्धपत्र/नियमावलीमा संशोधन साथै शेयरलगत अभिलेख बारे ।",
    "content" : "\tत्यस कम्पनीले कम्पनी ऐन, २०६३ बमोजिम पेश गर्नु पर्ने आ.व. ०७७/०७८ सम्मका विवरणहरु पेश गरेको हुनाले सो आ.व.सम्म कम्पनी अध्यावधिक रहेको साथै कम्पनीको मिति २०७९/०३/१९ को  संचालक समितिको निर्णयानुसार कम्पनी ऐन, २०६३ को दफा ३१ को बमोजिम यस कार्यालयमा पेश गरेको कम्पनी ऐन, २०६३ को दफा ४६ बमोजिम तयार शेयरधनी दर्ता किताब प्राप्त भएकोले सो बमोजिम भए गरेको काम कार्बाहीको उत्तरदायित्व र जिम्मेवारी कम्पनी र कम्पनीका सञ्चालकहरुको रहने गरी सो शेयरधनी दर्ता किताब अभिलेख गरिएको छ ।\r\n\tत्यस कम्पनीको मिति २०७९।०३।१३ मा सम्पन्न एकल शेयरधनीको विशेष बैठकको निर्णय वमोजिम साविक कम्पनी ( नेपाल स्मार्ट लोकसेवा  प्रा.लि. को नाममा रहेको सम्पूर्ण चल अचल सम्पत्ति तथा तिर्नु व्यहोर्नु पर्ने कर दायित्व आदि परिवर्तित नाम (इफोर्ट एकेडेमीप्रा.लि.)को कम्पनीले सकार्ने व्यहोर्ने साथै कम्पनीको नाम परिवर्तनको सम्वन्धमा ३० (तीस) दिनभित्र राष्ट्रिय स्तरको पत्रपत्रिकामा ३ पटक सार्वजनिक सूचना प्रकाशन गरी सोको प्रति यस कार्यालयमा पठाउने र कम्पनीको लेटर हेडमा तलपट्टी साविक कम्पनीको नाम कम्तीमा १ वर्षसम्म उल्लेख गर्ने साथै नामका सम्वन्धमा भ्रम सृजना भई उजुरी परेमा संशोधन गर्ने शर्तमा त्यस कम्पनीको नाम परिवर्तन गरी लालि गुँरास पोल्ट्री एण्ड एग्रो फार्म प्रा.लि. कायम गर्न स्वीकृति प्रदान गरिएको छ । त्यस कम्पनीको सोही निर्णय बमोजिम कम्पनीको रजिष्टर्ड कार्यालयको ठेगाना स्थानान्तरण गरी बाँके , कोहलपुर न.पा. वडा नं.०४  मा राख्नज स्विकृती प्रदान गरिएको छ । \r\n\tसाथै कम्पनीको प्रबन्ध पत्रको दफा १ र २ तथा नियमावलीको नियम १, २  मा गरेको संशोधन अभिलेख गरी अभिलेखित प्रवन्ध पत्र/नियमावली संशोधन र शेयरलगतको १/१ प्रति यसै साथ पठाइएको व्यहोरा मिति २०७९।०३।३० को निर्णयानुसार जानकारी गराइन्छ ।\r\n",
    "fiscalYear" : "78/79",
